import React from 'react';

const ReviewList = ({ reviews }) => {
  return (
    <ul>
      {reviews.map((review, index) => (
        <li key={index}>
          <p><strong>{review.user}</strong> rated it {review.rating}/5</p>
          <p>{review.comment}</p>
        </li>
      ))}
    </ul>
  );
};

export default ReviewList;
